import React from 'react'
import PosterSlider from '../Components/PosterSlider/PosterSlider'
import ProductSlider from '../Components/ProductSlider/ProductSlider'
import productype from '../Assets/productype'

const Home = () => {
  return (
    <div>
      <PosterSlider/>
      {productype.map((item,i)=>{
          return <ProductSlider category={item.name}/>
      })}
    </div>
  )
}

export default Home
